import React from "react";
import Socials from "./Socials";
import About from "./About";

export default function Layout() {
  return (
    <>
      <div className="card flex-wrap">
        <div className="card-body d-flex justify-content-between">
          <div className="flex-row ">
            <Socials />
          </div>
          <div className="flex-row col-7">
            <About />
          </div>
        </div>
      </div>

      <section className="mt-5 container-fluid d-flex justify-content-around">
        <div id="layout" className="w-50 justify-content-between d-flex p-5">
          <Socials />
          <About />
        </div>
      </section>
    </>
  );
}
